keyVal = 0;
keyFlags = 0;

function keyDown(e) {
    if( is.ie ) e = event
    keyVal = 0
    if( e.keyCode == 18 )
        keyFlags = keyFlags | 1
    else if( e.keyCode == 17 )
        keyFlags = keyFlags | 2
    else if( e.keyCode == 16 )
        keyFlags = keyFlags | 4
    else
        keyVal = e.keyCode

    if( keyFlags == 6 && keyVal == 39 ){action49456();}
    if( keyFlags == 2 && keyVal == 100 ){action1264980();}
}

function keyUp(e) {
    if( is.ie ) e = event
    if( e.keyCode == 18 )
        keyFlags = keyFlags & ~1
    else if( e.keyCode == 17 )
        keyFlags = keyFlags & ~2
    else if( e.keyCode == 16 )
        keyFlags = keyFlags & ~4
}

text1627997.addInnerText('<div id=\"text1627997\"><a id=\"text1627997anc\" tabindex=\"199\"style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.168\" style=\"margin-left:0px;text-indent:0px;line-height:1.168;margin-top:0px;margin-bottom:27px;text-align:left;\" >\n<span class=\"text1627997Font1\"  >CTI is a trusted, proactive, and engaged partner in enabling effective HCC technologies and solutions across the enterprise to influence business decisions and manage risks. CTI focus areas are: Core Systems Support (e.g., TPI Due Diligence Mgmt.), Regional Support and Global Data Enablement (GDE)\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text1627997Font3\" data-bltIndnt=\"0\" style=\"line-height:1.168;position:relative;margin-left:15px;margin-top:0px;margin-bottom:27px; list-style-image:url(\'images/text1627997CircleBulletFont8.png\'); padding-left:8px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text1627997Font1\"  >CTI Responsibilities:</span ><span class=\"text1627997Font2\"  > </span ><span class=\"text1627997Font3\"  >Enabling effective HCC technologies and solutions across the enterprise including global and regional strategy, deployment, maintenance and oversight of these solutions.\n</span ></li >\n</ul >\n</div>\n');

); padding-left:7px;\"><!--{ \ndata-bltIndnt:38\n} --><span class=\"text1627996Font2\"  >Own and develop a common HCC data technology and solution\n</span ></li >\n<li  class=\"text1627996Font2\" data-bltIndnt=\"38\" style=\"line-height:1.168;position:relative;margin-left:53px;margin-top:0px;margin-bottom:7px; list-style-image:url(\'images/text1627996SquareBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:38\n} --><span class=\"text1627996Font2\"  >Enable data governance and quality initiatives\n</span ></li >\n<li  class=\"text1627996Font2\" data-bltIndnt=\"38\" style=\"line-height:1.168;position:relative;margin-left:53px;margin-top:0px;margin-bottom:7px; list-style-image:url(\'images/text1627996SquareBulletFont8.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:38\n} --><span class=\"text1627996Font2\"  >Develop new and innovative approaches to HCC problems and challenges\n</span ></li >\n</ul >\n</div>\n');

function getFillBrowserScale()
{
		//console.log('getFillBrowserScale(); Override')
	var dv = GetCurrentPageDiv();		//OPA: getCurrentPageDiv();
	//triv$(dv).show();
	var myTitleWidth = dv.clientWidth;
	var myTitleHeight = dv.clientHeight;
	findWH(); // populates winW and winH
	var winHeight = winH;
	var winWidth = winW;
	var windowH = ( winHeight > 1 ? winHeight - 1 : winH > 0 ? winH : 100 );
	var windowW = ( winWidth > 0 ? winWidth : winW > 0 ? winW : 100 );
	var scale1 = windowW / myTitleWidth;
	var scale2 = windowH / myTitleHeight;
	if ( window.bFitToWidth )
	{
		//var adjTitleW = myTitleWidth * scale1;
		var adjTitleH = myTitleHeight * scale1;	// height is scaled by the width's scale in window.bFitWidth
		if ( windowH < adjTitleH  )
		{
			windowW = winW;
			scale1 = windowW / myTitleWidth;
		}
	}
	var scaleFill = window.bFitToWidth ? scale1 : Math.min(scale1,scale2);
	var scaleOffset = parseInt(scaleFill == scale1 ? 0 : (windowW/2) - ((scaleFill*myTitleWidth) / 2));
	var scaleOffsetY = parseInt(scaleFill == scale2 ? 0 : (windowH/2) - ((scaleFill*myTitleHeight) / 2));
	//console.log('windowW: ' + windowW)
	//console.log('myTitleWidth: ' + myTitleWidth)
	//console.log('scaleFill: ' + scaleFill)
	//console.log('scaleOffset: ' + scaleOffset)
	var transX = -parseInt( ((myTitleWidth - (scaleFill*myTitleWidth))/2)) + scaleOffset;
	var transY = -parseInt( ((myTitleHeight - (scaleFill*myTitleHeight)) / 2)) + scaleOffsetY;
	if ( window.bFitToMobile && is.isMobile.any())
	{
		var scaleFill = Math.min(scale1,scale2);
		var transX = 0, transY = 0;
	}
	else if (is.isMobile.any())
		transX = 0, transY = 0;
	return	{
		'scale':	scaleFill,
		'offsetX':	transX,
		'offsetY':	transY,
		'scaleW' : scale1,
		'scaleH' : scale2,
		'windowW': windowW
	};
}
</script>
